var app=angular.module("tableApp",[]);app.controller("tableCtrl",function($scope){$scope.countRow=50,$scope.countCol=50,$scope.createTable=function(max_row,max_col){for(var tableData=[],row=0;max_row>row;row++){tableData[row]=[];for(var col=0;max_col>col;col++)tableData[row].push({name:"row_"+row+"&col_"+col})}return console.log("tableData",tableData),tableData},$scope.table=$scope.createTable($scope.countRow,$scope.countCol)});